O Gás de cozinha é a opção mais econômica para o consumidor, se comparado por exemplo a energia elétrica. Veja as vantagens e desvantagens que a Gás Lar vem mostrar para você: 
✅ Vantagens do Gás
- Pode continuar a cozinhar, sem eletricidade;
- Responde imediatamente quando se liga;
- O gás é uma energia limpa, com esta opção o ambiente agradece;
- Fácil de ajustar com precisão o nível de calor que precisa para cozinhar;
- Além de deixar o gosto da comida muito mais saboroso.
❌ Desvantagens do Eletrodoméstico
- Mais lento a cozinhar; 
- Sem energia não funciona;
- Estima-se que só o forno elétrico consome, em média, mais de 40% de energia que o forno a gás
- O móvel onde o forno é instalado deve estar preparado para suportar a temperatura do forno.
#GásLar #LiquiGás #GásEconômico #BoaTarde

